import {connect} from 'react-redux';
import * as actions from "../../redux/actions/actions"
import React from "react"

class Officer extends React.Component{
  constructor(props){
    super(props);
    this.state = {};
  }
  componentDidMount() {
    this.props.clear();
    if(this.props.id !== ""){
      console.log("send"+this.props.id);
      this.props.getOneUser(this.props.id);
    }
  }
  render() {
    console.log(this.props);
    return (
      <td onClick={() => this.props.getDS()}>{this.props.officeruser.data.Name}</td>
    );
  }
}
const mapStateToProps = state => {
  return {
    officeruser: state
  };
};

const mapDispatchToProps = dispatch => {
  return {
    getOneUser: (Id) => {
      dispatch(actions.getOneUser(Id));
    },
    clear: () => {
      dispatch(actions.userClear());
    },
  };
};
export default connect(mapStateToProps, mapDispatchToProps)(Officer)
